// Routes.js
import { AUTH } from '../Views/AUTH/AUTH';
import { Blogs } from '../Views/AUTH/Blogs';

const MyURLs = [
    {
        path: "/",
        view: AUTH,
        title: "AUTH"
    },
    {
        path: "/blogs", // Make sure this matches exactly
        view: Blogs,
        title: "Blogs"
    }
];

export default MyURLs;
